import React from "react";
import { Link } from "react-router-dom";
import Monos from "../img/monos.png";
import Flechaizq from "../img/Flecha.png";
import "../Styles/Proyectos.css";
const Proyectos = () => {
  return (
    <div class="container">
      <div className="proyectos-title">
        <h1>
          <span className="pro">Pro</span>yectos
        </h1>
      </div>
      <div className="proyectos">
        <div className="controles">
          <img src={Flechaizq} alt="" />
        </div>
        <div className="proyectos-cards">
          <div className="card">
            <img src={Monos} alt="" />
            <h5>
              It is a long established fact that a reader will be distracted by
              the child child child child child child.
            </h5>
            <img src="" alt="" />
            <img src="" alt="" />
            <img src="" alt="" />
            <img src="" alt="" />
          </div>
        </div>
      </div>
    </div>
  );
};

export default Proyectos;
